INSERT INTO `BLOG_ARTICLE` (`ID`, `TITOLO`, `TESTO_LIMITED`, `TESTO`, `AUTORE`, `IMAGE`, `DATA_CREAZIONE`) VALUES
(1, 'Multilinguals - different personalities', '<p>Do I change my personality when I speak in another language? Or am I simply schizophrenic?...</p>', '<p>Do I change my personality when I speak in another language? Or am I simply schizophrenic?</p>\n<p>I was always curious how languages affect our personalities. Here is an interesting atricle about this topic:</p>\n<p>„Many multilinguals report <strong>different personalities</strong>, or even different worldviews, when they speak their different languages.</p>\n<p>There are still good reasons to believe language shapes thought.</p>\n<p>This influence is not necessarily linked to the vocabulary or grammar of a second language. Significantly, most people are not symmetrically bilingual. Many have learned one language at home from parents, and another later in life, usually at school. So bilinguals usually have different strengths and weaknesses in their different languages—and they are not always best in their first language. For example, when tested in a foreign language, <strong>people are less likely to fall into a cognitive trap</strong> (answering a test question with an obvious-seeming but wrong answer) than when tested in their native language. In part this is because working in a second language slows down the thinking. No wonder people feel different when speaking them. And no wonder they feel looser, more spontaneous, perhaps more assertive or funnier or blunter, in the language they were reared in from childhood.</p>\n<p>What of “crib” bilinguals, raised in two languages? Even they do not usually have perfectly symmetrical competence in their two languages. But even for a speaker whose two languages are very nearly the same in ability, there is another big reason that person will feel different in the two languages. This is because there is an important distinction between bilingualism and biculturalism.</p>\n<p>Many bilinguals are not bicultural. But some are. And of those bicultural bilinguals, we should be little surprised that they feel different in their two languages. Experiments in psychology have shown the power of “priming”—small unnoticed factors that can affect behaviour in big ways. Asking people to tell a happy story, for example, will put them in a better mood. The choice between two languages is a huge prime. Speaking Spanish rather than English, for a bilingual and bicultural Puerto Rican in New York, might conjure feelings of family and home. Switching to English might prime the same person to think of school and work.”</p>\n<p><a href="http://www.economist.com/blogs/prospero/2013/11/multilingualism" target="_blank">http://www.economist.com/blogs/prospero/2013/11/multilingualism</a></p>', 'Szigeti Boglarka', '\', '2015-07-02 14:09:37');
INSERT INTO `BLOG_ARTICLE` (`ID`, `TITOLO`, `TESTO_LIMITED`, `TESTO`, `AUTORE`, `IMAGE`, `DATA_CREAZIONE`) VALUES
(3, 'Il «Talian» diventa patrimonio culturale del Brasile', '<p>Siamo alla <strong>fine del 1870</strong> e milioni di italiani decidono di partire verso le più disparate destinazioni del globo in cerca di fortuna. Meta preferita: </strong>l''America</strong>...</p>', '<p>Siamo alla <strong>fine del 1870</strong> e milioni di italiani decidono di partire verso le più disparate destinazioni del globo in cerca di fortuna. Meta preferita: </strong>l''America</strong>.</p>\n<p>Ma il continente americano è grande e così può accadere che un idioma dialettale, di chiarissima provenienza straniera veneta, lasci un segno indelebile nel contesto culturale e linguistico di una popolazione autoctona.</p>\n<p>E'' questo il caso del <strong>Talian</strong>. Un dialetto brasiliano, la cui struttura grammaticale è strettamente legata al dialetto veneto. Pensate che tutt''oggi con il termine Taliani, in Veneto e Friuli, sono indicati tutti gli emigrati originari del nord-est.</p>\n<p>Durante il governo del presidente <strong>Getùlio Vargas iniziò una campagna nazionalistica</strong> per provare a costringere i locutori non portoghesi del Brasile a "integrarsi meglio" nella cultura dominante nazionale. Parlare Talian in pubblico o persino nella propria casa era considerato <strong>offensivo</strong> e antipatriottico e meritevole di severe punizioni.</p>\n<p>Oggi i dialetti godono di maggior fortuna, vedendosi attribuire in alcuni casi il riconoscimento di <strong>patrimonio culturale</strong>: simbolo dei tempi che cambiano e di una mentalità che riconosce l''importanza delle diversità,anche linguistiche.</p>\n<p>Questa è stata la storia del <strong>Talian in Brasile</strong>.</p>\n<br/>\n<p>Ecco come parlano Talian in Brasile:</p>\n\n<div class="text-center">\n	<iframe width="480" height="290" src="https://www.youtube.com/embed/Cy019xAU1As" frameborder="0" allowfullscreen></iframe>\n</div>\n<p>fonti:</p> \n<p><a href="http://it.wikipedia.org/wiki/Talian" target="_blank">http://it.wikipedia.org/wiki/Talian</a></p>\n<p><a href="http://corrieredelveneto.corriere.it/veneto/notizie/cronaca/2014/20-novembre-2014/talian-diventa--patrimonio-culturale-brasile-230577800491.shtml" target="_blank">http://corrieredelveneto.corriere.it/veneto/notizie/cronaca/2014/20-novembre-2014/talian-diventa--patrimonio-culturale-brasile-230577800491.shtml</a></p>', 'Szigeti Boglarka', '\\n', '2015-07-03 06:09:37');
INSERT INTO `BLOG_ARTICLE` (`ID`, `TITOLO`, `TESTO_LIMITED`, `TESTO`, `AUTORE`, `IMAGE`, `DATA_CREAZIONE`) VALUES
(4, 'Dove nasce la lingua Ungherese?', '<p>Da sempre ci si è chiesti come le antiche popolazioni abbiano abitato i continenti europeo e asiatico...</p>', '<p>Da sempre ci si è chiesti come le antiche popolazioni abbiano abitato i continenti europeo e asiatico.</p>	\n<p>Secondo uno studio moderno, che prova a risolvere questo enigma da un angolazione del tutto innovativa, l''uomo non è giunto in Europa tramite fenomeni migratori,come tradizionalmente sostenuto, ma era stanziato in questo continente già ai tempi dell''Homo sapiens.</p>\n<p>Secondo questo approccio dobbiamo rovesciare le nostre convinzioni: sarebbero, dunque, i Latini ad essere eredi dei popoli Indoeuropei e gli Etruschi sarebbero gli invasori.</p>\n<p>L''archeologia ha dimostrato che le origini di questa popolazione sarebbero state da ricercare nell''area danubio-carpatica e che la conquista dell''Ungheria coincide con una vera e propria invasione del Bacino Carpatico, ben nota agli archeologi, che ebbe luogo alla fine del III millennio.</p>\n<p>La linguistica ha poi confermato che....beh leggetevi l''articolo!</p>\n\n<p><a href="http://www.italcultbudapest.hu/Italia-Italy/Italia%20&%20Italy%20-%20Nov-Dic%202005/43-45.pdf" target="_blank">Etrusco, una forma arcaica di ungherese?</a></p>', 'Szigeti Boglarka', '\', '2015-07-02 14:09:37');
INSERT INTO `BLOG_ARTICLE` (`ID`, `TITOLO`, `TESTO_LIMITED`, `TESTO`, `AUTORE`, `IMAGE`, `DATA_CREAZIONE`) VALUES
(6, 'Poche regole per imparare a scrivere in italiano', '<p>1.	<strong>Da o dà</strong>? Dipende dai casi: se preposizione semplice si usa <strong>"da"</strong>, se voce del verbo dare si usa...</p>', '<p>1.	<strong>Da o dà</strong>? Dipende dai casi: se preposizione semplice si usa <strong>"da"</strong>, se voce del verbo dare si usa <strong>"dà"</strong>. Esiste un ulteriore caso: se si utilizza come imperativo alla seconda persona singolare vuole l''apostrofo.</p>\n<p>2.	<strong>Un po, un pò o un po''</strong>? La forma corretta è con l''apostrofo: <strong>un po''</strong>.</p>\n<p>3.	<strong>A volte o avvolte</strong>? La forma corretta è staccata: <strong>"a volte"</strong>.</p>\n<p>4.	<strong>Desse o dasse? Stesse o stasse</strong>? Le forme corrette di questi congiuntivi sono <strong>desse e stesse</strong>.</p>\n<p>5.	<strong>Entusiasto o entusiasta</strong>? La forma corretta anche in caso di riferimento a un nome maschile è <strong>entusiasta</strong>; al plurale invece torna la distinzione fra maschile e femminile:<strong>entusiasti</strong> ed <strong>entusiaste</strong>.</p>\n<p>6.	<strong>E o ed</strong>? A o ad? La <strong>d</strong> nell''italiano contemporaneo si usa nel caso in cui la parola che segue cominci con la stessa vocale: vado ad Ancona. Se la parola successiva inizia per vocale diversa  la d eufonica è facoltativa e non viene considerata errore: vado a Empoli, vado ad Empoli. Se la parola successiva inizia con h aspirata (Heine, Hitler) la d eufonica non si usa, a meno che non si tratti di un prestito straniero ormai assimilato (hobby, handicap).</p>\n<p>7.	<strong>Qual''è o qual è</strong>? Buon''uomo o buon uomo? Tal''uomo o tal uomo? Pover''uomo o pover uomo? Tutte queste forme sono corrette senza apostrofo: <strong>"qual è"</strong>.</p>\n<p>8.	<strong>Si o sì</strong>? In caso di particella affermativa va accentato, in tutti gli altri casi no.</p>\n<p>9.	<strong>-zzione o -zione</strong>? La forma corretta è senza doppia Z, ad esempio interroga<strong>zione</strong>.</p>\n<p>10.	<strong>Fa o fà</strong>? La forma corretta è senza accento: <strong>"fa"</strong>. Se seconda persona singolare al tempo imperativo del verbo fare diventa fa'' perché apostrofata per elisione dell''ultima lettera.</p>\n<p>11.	<strong>Un''amica o un amica</strong>? Un''amico o un amico? L''apostrofo va usato solo se le parole sono femminili, quindi la forma corretta è: <strong>un''amica e un amico</strong>.</p>\n<p>12.	<strong>Ne o né</strong>? L''accento si utilizza quando viene utilizzato come negazione: non si può né toccare né rompere. In tutti gli altri casi si utilizza senza accento: ne.</p>\n<p>13.	<strong>Per cui o percui</strong>? La forma corretta è staccata: <strong>per cui</strong>.</p>\n<p>14.	<strong>A fianco o affianco</strong>? <strong>A fianco</strong> si usa per dire "a lato di", <strong>affianco</strong> è la prima persona singolare del presente indicativo del verbo affiancare.</p>\n<p>15.	<strong>Accellerare o accelerare</strong>? La forma corretta è senza doppia L: <strong>"accelerare"</strong>.</p>\n<p>16.	<strong>Daccordo o d''accordo</strong>? La forma corretta è <strong>"d''accordo"</strong>.</p>\n<p>17.	<strong>Tuttuno o tutt''uno</strong>? Tuttaltro o tutt''altro? La forma corretta è <strong>"tutt''uno"</strong> e <strong>"tutt''altro"</strong>.</p>\n<p>18.	<strong>Celeberrimo o celebrissimo</strong>? Il superlativo assoluto di celebre è <strong>"celeberrimo"</strong>.</p>\n<p>19.	<strong>Meteorologia o metereologia</strong>? La forma corretta è <strong>"meteorologia"</strong>.</p>\n<p>20.	<strong>Sopratutto o soprattutto</strong>? La forma corretta è con la doppia T: <strong>"soprattutto"</strong>.</p>\n<p>21.	<strong>E'' piovuto o ha piovuto</strong>? Se il verbo <strong>piovere</strong> si utilizza per indicare la pioggia che cade dal cielo sono corrette entrambe le forme; in tutti gli altri casi, ad esempio <strong>"piovere critiche"</strong>, si deve utilizzare il verbo essere.</p>\n<p>22.	<strong>Se stesso o sé stesso</strong>? Quando il se è accompagnato da stesso l''accento non è necessario. Quando troviamo il se come forma ipotetica l''accento non ci vuole, ad esempio "se fosse andato". Quando troviamo il se come forma non ipotetica bisogna mettere l''accento, ad esempio "corre da sé".</p>\n<p>23.	<strong>C o Q</strong>? Ecco un elenco di parole che si scrivono con la C e che si possono confondere: <strong>evacuare, proficuo, scuotere, riscuotere, promiscuo, innocuo</strong>.</p>\n<p>24.	<strong>Vada o vadi? Faccia o facci</strong>? La forma corretta del congiuntivo presente del verbo andare è <strong>"vada"</strong>.  La forma corretta del congiuntivo presente del verbo fare è <strong>"faccia"</strong>.</p>\n<p>25.	<strong>A me mi piace o a me piace</strong>? La forma corretta nella maggior parte dei casi è <strong>"a me piace"</strong>. Da qualche tempo l''accademia della crusca ha affermato che la forma "a me mi" è passabile purché rafforzativa anziché pleonastica.</p>\n<p>26.	<strong>Nè o né? Perchè o perché? Poichè o poiché</strong>? L''accento corretto è quello acuto: <strong>né, perché,  poiché</strong>.</p>\n<p>27.	<strong>Bracci o braccia</strong>? Per indicare i bracci di un fiume o di una gru si usa <strong>"bracci"</strong>, per indicare la parte specifica del corpo umano si usa <strong>braccia</strong>.</p>\n\n<p><a href="http://matteograsso.blogspot.it/2011/12/i-27-errori-piu-comuni-della-lingua.html" target="_blank">http://matteograsso.blogspot.it/2011/12/i-27-errori-piu-comuni-della-lingua.html</a></p>', 'Luca Sapone', '\', '2015-07-01 14:09:37');
